const windowWidth = window.innerWidth
const windowHeight = window.innerHeight

const $canvas = document.querySelector('#scene')

const img_space = 'data:image/jpeg;base64,'
const img_planetDay = 'data:image/jpeg;base64,'
const img_planetNight = 'data:image/jpeg;base64,'
const img_moon = 'data:image/jpeg;base64,'

$canvas.width = windowWidth
$canvas.height = windowHeight

const params = {
    deltaX: 0
}

let day = true

const renderer = new THREE.WebGLRenderer({
    canvas: $canvas,
    alpha: true
})
renderer.setClearColor(0x000000, 0)

let camera = new THREE.PerspectiveCamera(45, windowWidth / windowHeight, 1, 5000)
camera.position.set(0, 0, 1000)

const scene = new THREE.Scene()
let light = new THREE.AmbientLight(0xffffff)
scene.add(light)

let textureLoader = new THREE.TextureLoader()

let planet
let planetGeometry
let planetMaterials
textureLoader.load(img_planetDay, texture => {
    planetGeometry = new THREE.SphereGeometry(200, 50, 50)
    planetMaterials = new THREE.MeshBasicMaterial({ map: texture })
    planet = new THREE.Mesh(planetGeometry, planetMaterials)
    planet.position.x = 0
    planet.position.y = 0
    scene.add(planet)
    renderer.render(scene, camera)
})

let moon
textureLoader.load(img_moon, texture => {
    let moonGeometry = new THREE.SphereGeometry(70, 50, 50)
    let moonMaterials = new THREE.MeshBasicMaterial({ map: texture })
    moon = new THREE.Mesh(moonGeometry, moonMaterials)
    moon.position.x = 300
    moon.position.y = 200
    scene.add(moon)
    renderer.render(scene, camera)
})

let rotate = 0
let startTime = new Date().getTime()
function draw() {
    let currTime = new Date().getTime()
    let progress = (currTime - startTime) / 1000 * .5

    if (planet) {
        planet.rotation.y += progress * 1.5
        renderer.render(scene, camera)
    }
    if (moon) {
        moon.rotation.y += progress
        renderer.render(scene, camera)
    }
    scene.rotation.x = rotate
    scene.rotation.y += progress
    renderer.render(scene, camera)

    startTime = new Date().getTime()
    requestAnimationFrame(draw)
}


window.onload = () => {
    let touch = false
    let touchStart = 0
    document.querySelector('body').addEventListener('mousedown', e => {
        touch = true
        touchStart = e.pageY
    })
    document.querySelector('body').addEventListener('mousemove', e => {
        if (touch) {
            if (touchStart < e.pageY) rotate += .01
            else rotate -= .01
        }
    })
    document.querySelector('body').addEventListener('mouseup', e => {
        touch = false
    })
    draw()
    document.querySelector('[data-day-toggle]').addEventListener('click', e => {
        day = day ? false : true
        if(day) {
            textureLoader.load(img_planetDay, texture => {
                planetMaterials.map = texture
                planetMaterials.needsUpdate = true
                renderer.render(scene, camera)
            })
        } else {
            textureLoader.load(img_planetNight, texture => {
                planetMaterials.map = texture
                planetMaterials.needsUpdate = true
                renderer.render(scene, camera)
            })
        }
    })
}